    false,nt"url": null,nt"notes": "The NHDPlus Version 1.0 is an integrated
    suite of application-ready geospatial data sets that incorporate many of the best
    features of the National Hydrography Dataset (NHD) and the National Elevation Dataset
    (NED). The NHDPlus includes a stream network (based on the 1:100,000-scale NHD),
    improved networking, naming, and "value-added attributes" (VAA's). NHDPlus also
    includes elevation-derived catchments (drainage areas) produced using a drainage
    enforcement technique first broadly applied in New England, and thus dubbed "The
    New-England Method". This technique involves "burning-in" the 1:100,000-scale
    NHD and when available building "walls" using the national Watershed Boundary
    Dataset (WBD). The resulting modified digital elevation model (HydroDEM) is used
    to produce hydrologic derivatives that agree with the NHD and WBD. An interdisciplinary
    team from the U. S. Geological Survey (USGS), U.S. Environmental Protection Agency
    (USEPA), and contractors, over the last two years has found this method to produce
    the best quality NHD catchments using an automated process. The VAAs include greatly
    enhanced capabilities for upstream and downstream navigation, analysis and modeling.
    Examples include: retrieve all flowlines (predominantly confluence-to-confluence
    stream segments) and catchments upstream of a given flowline using queries rather
    than by slower flowline-by-flowline navigation; retrieve flowlines by stream order;
    subset a stream level path sorted in hydrologic order for stream profile mapping,
    analysis and plotting; and, calculate cumulative catchment attributes using streamlined
    VAA hydrologic sequencing routing attributes. The VAAs include results from the
    use of these cumulative routing techniques, including cumulative drainage areas,
    precipitation, temperature, and land cover distributions. Several of these cumulative
    attributes are used to estimate mean annual flow and velocity as part of the VAAs.
    NHDPlus contains a snapshot (2005) of the 1:100,000-scale NHD that has been extensively
    improved. While these updates will eventually make their way back to the central
    NHD repository at USGS, this will not have happened prior to distribution of NHDPlus
    because the update process for the central NHD repository is still in development.
    Consequently, the NHDPlus will contain some temporary database keys and, as a result,
    NHDPlus users may not make updates to the NHD portions of NHDPlus with the intent
    of sending these updates back to the USGS. Once the NHDPlus updates have been posted
    to the central NHD repository, a fresh copy of the improved data can be downloaded
    from the central NHD repository and that copy will be usable for data maintenance.
    Note that the NHDPlus products are tightly integrated and user modifications to
    the underlying NHD can compromise this synchronization.",nt"license_title":
